import {configureStore} from "@reduxjs/toolkit";
import counterReducer from '../store/counterSlice'
import authSlice from '../store/authSlice'

const store=configureStore({
    reducer:{
        count:counterSlice,
        auth:authSlice
    }
});

export default store;
